insert into `program` values (311,1419,1998,37,6,1,'08:30 pm','12:30 pm','4.0',4.5,0,0,0,0,'The format of the program was changed here for two reasons on the suggestion of Dr Arif Rasheed.\r\nIll health of Dr Israr Ahmed.\r\nTo make available a recording of the summary of Topics in Quran for use in Ramzan at places where there is less time available.\r\n\r\nProgram Format was as follows\r\nNamaz e Isha\r\nSummary of Quranic Ayahs to be recited in 8 rakats\r\n8 Rakat Taravih in one hour\r\nSummary of Quranic Ayahs to be recited in 12 rakats in one hour\r\n20 minutes break for refreshments\r\n12 Rakat Taravih and Salat ul Witr\r\n30 minutes Question Answer Session \r\n\r\nOne speciality of this program was the attendance.\r\nInspite cold weather, a lot of people from all parts of Lahore used to come regularly with their families.\r\nNo empty place was seen in masjid, and two separate halls arranged for ladies and children also remained jam packed all the time.\r\n\r\nA large number of people decided to be a part of the struggle for Nizam e Khilafat with Dr Israr Ahmed and joined Tanzeem e  Islami.\r\n\r\nA comprehensive feature was published by Daily Pakistan Lahore about this program on 14th January 1999 covering two complete pages in its special publication.','+92-42-5858212,+92-42-5845090',1);
