insert into `programfeedback` values (16,'2007-09-08 18:29:01',490,303,4,4,1,2,1,1,2,2,2,'Good management Rufaqas pressence some one to speak get answers to questions','','Should have a comfortable sitting','Good recitation is a must for this type of programme & should be present during the DAURA TARJUMA(Khulasa)','Management should be very very committed should also listen to the speaker during the prog','Something that greatly changed me & my life. Very much impressed by the commitment of the speaker.','Something that greatly changed me & my life although I didnt practised ,but very much impressed by the commitment of the speaker (dont remember his name I think it was Mr Saleem or Salman)a year back now I am in Sweden & Inshallah benefit by the life prog.');
insert into `programfeedback` values (17,'2007-09-12 14:27:12',693,328,2,3,1,1,1,1,2,1,1,'Do not ask About Next Year or Put like this \"Yes Inshallah\"','no','no','no','no','','Very Nice endeavour makes it cool and more attractive by COOL colour contrast and cool attraction are available around us. Regarding effort and collection of data and struggle I really appreciated it\'s very nice really I mean it Jazak Allah Kum Khaier Allah Increase your worth more and accept your effort (Ameen)(Syed Ejaz Ul Haque Karachi)');
insert into `programfeedback` values (18,'2007-09-14 10:22:25',505,359,7,4,1,3,3,2,1,1,2,'','','','','','Truly inspirational ','For so long, there was a thought in my mind that during Ramadan we have such a big advantage of tariavi that we could get to hear about the entire Quran, but it was just becoming a formal religious activity. Now with this step of the Quran translations we have obtained another chance to know what the Allah says and then inshaAllah act accordingly.. SubhanAllah');
insert into `programfeedback` values (19,'2007-09-19 13:27:48',505,404,1,4,1,1,1,1,1,1,2,'','','','','','Aswk, I am from Bangalore, India. I am very delighted to hear about this event. I wish this could have been possible in india also.','Aswk,\r\nMy name is Syed Tahseem Aadil. I stay in Bangalore, India. MashAllah it looks a wonderful program to be a part of. I am a regular visitor of Tanzeem.org. I would also have love to be a part of the such a dora tarjuma-ul-Qur\'an. Unfortunately in India, we done have such arrangements[According to my knowledge]. I request my pakistani brothers to remember me also in their precious duas.\r\n\r\nAllah Hafiz');
