insert into `programfeedback` values (51,'2008-08-28 16:12:13',697,604,4,4,1,1,1,1,1,1,1,'','','','','','It really opened my eyes......I got to know the creation of us...Immediately after the completion of ramazan I joined the Arabic course and Alhamdulillah now I have joined Tanzeem. Thanks to ALLAH, Dr. Sahib, and Tanzeem-gulistan-e-jauher.','Alhamdulillah It changed my way of thinking...I know now for what we are to be sent and what is the purpose of our life, and it gives me a platform to perform well according to Islam. Jazakallah.');
