insert into `user` values (1,'ehsantemp@yahoo.com','e','e','Mr','Ehsan ul haq','Qureshi','m','1983-05-04','+92-334-3380785','+92-21-2239849','+92-42-1234567','','D-74, Pakistan Quarters, Garden West, Nishter Road','','Karachi','Sindh','PK','Bachelor of Science (Computer Science)','Software Engineer','Born in Karachi, Pakistan 4th May 1985\r\nNamed by my Taya(Uncle), Ehsan ul Haq Qureshi\r\nDid my schooling in Hamdard Public School Class 2-8\r\nSpent 5 years hostel life at Cadet College Petaro Class 8-12\r\nCleared my Matriculation and Intermediate exams with A Grades\r\nFailed twice in ISSB for GDP in Pakistan AirForce(My earlier craze)\r\nNow I say it was good for me(I could not have shaven my beard nor could fight against Muslim Brothers)\r\nCompleted my Bachelor of Science in Computer Science from National University-FAST August 2002 to July 2006, So I am a Software Engineer now.\r\nDid Internships at Softech MicroSystems and PostAmazers during studies.\r\nDeveloped an interest in Computer Graphics and Media.\r\nListened Dora Tarjuma Quran at PIB Lawn, went for Aitakaf to Quran Academy Defense and did Beyat on 27th of Ramzan there.(My second birth)\r\nWorked as a Software/Research Engineer in Pixsense July 2006 to February 2007.\r\nAttended Quran Fehmi Course March to June 2007 with part time job at DevNext Solutions.\r\nWhat changed my life (Dora Tarjuma Quran) caused me to make this website www.doratarjumaquran.pk\r\nAlhamdulillah it has been a great period of my life after joining Tanzeem-e-Islami being associated with an Ijtimaiyat, throughout which many obstacles came but there was always someone to push me.\r\nMy message to anyone who reads this is \r\n\"Time is passing very fast, Earn whatever you can for the here after\"','2007-01-01','0000-00-00','No responsibilities yet',6,8,194,1,0,1,1);
insert into `user` values (2,'','israr2','israr2','Dr','Israr','Ahmed','m','1937-04-23','+92-334-3380785','+92-42-1234567','+92-42-1234567','','Quran Academy Lahore','','Lahore','Punjab','PK','MBBS','Medical Doctor','Dr. Israr Ahmad, the second son of a government servant, was born on April 26, 1932 in Hisar (a district of East Punjab, now a part of Haryana) in India. He graduated from King Edward Medical College (Lahore) in 1954 and later received his masters in Islamic Studies from the University of Karachi in 1965. He came under the influence of Allama Iqbal and Maulana Abul A`la Maududi as a young student, worked briefly for Muslim Student\'s Federation in the Independence Movement and, following the creation of Pakistan in 1947, for the Islami Jami`yat-e-Talaba and then for the Jama`at-e-Islami. Dr. Israr Ahmad resigned from the Jama`at in April 1957 because of its involvement in the electoral politics, which he believed was irreconcilable with the revolutionary methodology adopted by the Jama\'at in the pre-1947 period. \r\n\r\nWhile still a student and an activist of the Islami Jami`yat-e-Talaba, Dr. Israr Ahmad gained considerable fame and eminence as a Mudarris (or teacher) of the Holy Qur\'an. Even after resigning from the Jama`at, he continued to give Qur\'anic lectures in different cities of Pakistan, and especially after 1965 he has, according to his own disclosure, invested the better part of his physical and intellectual abilities in the learning and teaching of the Qur\'anic wisdom. \r\n\r\nDr. Israr Ahmad wrote an extremely significant tract in 1967 in which he explained his basic thought â€” that an Islamic Renaissance is possible only by revitalizing the Iman (true faith and conviction) among the Muslims, particularly their intelligentsia. The revitalization of Iman, in turn, is possible only by the propagation of the Qur\'anic teachings and presenting the everlasting wisdom of the Book of Allah (SWT) in contemporary idiom and at the highest level of scholarship. This undertaking is essential in order to remove the existing dichotomy between modern physical and social sciences on the one hand and the knowledge revealed by Almighty Allah (SWT) on the other. This tract is available in English as â€œIslamic Renaissance: The Real Task Aheadâ€?.\r\n\r\nDr. Israr Ahmad gave up his thriving medical practice in 1971 in order to launch a full-fledged and vigorous movement for the revival of Islam. As a result of his efforts, the Markazi Anjuman Khuddam-ul-Qur\'an Lahore was established in 1972, Tanzeem-e-Islami was founded in 1975, and Tahreek-e-Khilafat Pakistan was launched in 1991. \r\n\r\nDr. Israr Ahmad first appeared on Pakistan Television in 1978 in a program called Al-Kitab; this was followed by other programs, known as Alif Lam Meem, Rasool-e-Kamil, Umm-ul-Kitab and the most popular of all religious programs in the history of Pakistan Television, the Al-Huda, which made him a household name throughout the country. Although he did not like to receive it personally, Dr. Israr Ahmad was awarded Sitara-e-Imtiaz in 1981. He has to his credit over 60 Urdu books on topics related to Islam and Pakistan, 9 of which have been translated into English and other languages. \r\n\r\nIn the context of Qur\'anic exegesis and understanding, Dr. Israr Ahmad is a firm traditionalist of the genre of Maulana Mehmood Hassan Deobandi and Allama Shabeer Ahmad Usmani; yet he presents Qur\'anic teachings in a scientific and enlightened way, being also a disciple of Allama Iqbal and Dr. Muhammad Rafiuddin, and also because of his own background in science and medicine. Concerning the internal coherence of and the principles of deep reflection in the Qur\'an, he has essentially followed the thinking of Maulana Hameed Uddin Farahi and Maulana Ameen Ahsan Islahi, though even here he has further developed their line of argument. Dr. Israr Ahmad believes in a dynamic and revolutionary conception of Islam, and in this regard he is a disciple of Maulana Abul Kalam Azad and Maulana Sayyid Abul A`la Maududi. \r\n\r\nFor the last forty years or so, Dr. Israr Ahmad has been actively engaged not only in reviving the Qur\'an-centered Islamic perennial philosophy and world-view but also reforming the society in a practical way with the ultimate objective of establishing a true Islamic State, or the System of Khilafah. He has widely traveled abroad and the audio and video tapes of his Qur\'anic discourses in Urdu and English languages have circulated in thousands throughout the world.\r\n\r\nA master\'s thesis, entitled Dr. Israr Ahmad\'s Political Thought and Activities, was written by Ms. Shagufta Ahmad in the Islamic Studies department of Canada\'s Mac Gill University. This thesis is available from Markazi Anjuman Khuddam-ul-Qur\'an Lahore.\r\n\r\nDr. Israr Ahmed relinquished the leadership of Tanzeem-e-Islami in October, 2002  on grounds of bad health and Hafiz Aakif Saeed is the present Ameer of the Tanzeem to whom all rufaqaa of Tanzeem renewed their pledge of Baiyah.','1975-01-01','0000-00-00','',5,23,61,1,0,0,1);
insert into `user` values (4,'markaz@tanzeem.org','akif4','akif4','Hafiz','Akif','Saeed','m','1965-04-23','+92-334-3380785','+92-42-1234567','+92-42-1234567','','Quran Academy Lahore','','Lahore','Punjab','PK','MA','None','Mohtaram Hafiz Akif Saeed, the present Ameer of Tanzeem-e-Islami was born as the second son in January 1958 at Sahiwal in the renowned religious house hold of the founder of Tanzeem Islami Respected Dr. Israr Ahmed.\r\nGrowing up in an atmosphere of Islamic activism under the inspirational influence of his scholar father, he completed his early education from a variety of schools in Sahiwal, Karachi and Lahore, graduating from Government College, Lahore, and went on to complete his masters in philosophy with distinction from the University of Punjab in 1980. It was during his education, at a mature age, that he also completed his Hifz of the Quran from 1974-1977. \r\nIn 1975, on the occasion of launching of Tanzeem-e-Islami, an organized struggle for the supremacy of Allah (SWT)â€™s ordained Islamic system, in Pakistan, Hafiz Akif Saeed was among the founding members.\r\nHe acquired formal Islamic / Deeni education from the Quran Academy, a project of the Markazi Anjuman Khudam-ul-Quran established by Mohtaram Dr. Israr Ahmed. \r\nAfter completing his education, he decided to dedicate his life for the cause of Islam and accordingly joined, to serve in, the Quran Academy in 1982. He has been managing the Academic wing of the Quran Academy which included, in addition to the overall management, the academic publications and the editorial charge of the monthly Meesaq and Hikamat-i-Quran since 1983 and additionally taking over the editorial responsibility of the weekly Nida-e-Khilafat in 1995, all periodicals published under the auspices of Markazi Anjuman Khudam-ul-Quran and the Tanzeem-e-Islami.\r\nIn 1999, he was given the additional responsibility of the Quran College as its Nazim. Moreover he held the charge of the Media & Publications wing of Tanzeem-e-Islami as a Markazi Nazim from 1991 to 2002.\r\nAfter a long process of consultations initiated by the then Ameer/Founder of Tanzeem-e-Islami Dr. Israr Ahmed on the issue of the future imaarat of the Tanzeem, Hafiz Akif Saeedâ€™s name came to the forefront. Subsequent to further consultations and due diligence, Hafiz Akif Saeed was nominated as the successor and subsequently appointed as the Naib (Deputy) Ameer in 1999.\r\nHe carried out the responsibilities of Naib (Deputy) Ameer as well as the Nazim of Media & Publication wing of the Tanzeem simultaneously till he took over as the life long Ameer of Tanzeem-e-Islami upon the voluntary self retirement of Dr. Israr Ahmed in the year 2002.\r\nMay Allah (SWT) bestow upon him special blessings, guidance, protection and nusrah in fulfilling his personal as well as the collective responsibility of leading his rufuqa to eternal salvation and the establishment of the Islamic Khilafah (socio-politico economic Just world order.)','1975-01-01','','Ameer Tanzeem e Islami',5,23,61,1,1,0,1);
