insert into `websitefeedback` values (9,531,'2008-01-27 00:08:17','asalam o alykum\r\n\r\nquiz # 2 at http://doratarjumaquran.com/quiz.php?qid=2 :::\r\n\r\n\r\n(Please rechaek this question as from answers options , it seems as its ayah 104 not 103...jzk)\r\n\r\nquestion-6... \r\nWhich of the following statements is correct in the light of Ayah 103 of Surah Al-Baqarah? \r\n(a) The Christians used to vituperate and resort to double talk \r\n(b) The companions were stressed upon to listen attentively to Prophet Mohammad (PBUH) when in his company \r\n(c) Jews were ordered to honor and respect prophet Mohammad (PBUH) \r\n\r\n');
insert into `websitefeedback` values (10,703,'2008-12-31 07:14:19','Asslaam Alaykum,I am glad to read and hear such a good website,Jazakallah!\r\n\r\nI would like to hear from you about why women are not aloowed for taraveeh Namaz as i have noticed hundreds of muslim girls from Mumbai where I stay in and many pkaistani girls I have seen in Orkut are going around with Hindu Guys and in Mumbai it has become very common to see a Muslim girl wearing a scraf marrying a Hindu guy and changing her name to banerjee and patel,I think 90%the problem would be solved If women are allowed in the Mosques and for taraaveh.,where they would be meeting other muslimas and get to hear the Quran and pray with others.I am not big enough to advice someone but the Issue would get out of hand and the community may feel ashamed because of asome girls who are marrying outside the religion.Allah Hafiz!');
